var daDK={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Give lov til","Allow in your wallet":"Tillad i din pung","Allow {symbol} first":["Tillad ",["symbol"]," først"],"Allowance pending":"Godtgørelse afventer","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Der opstod en fejl under forsøg på at udføre denne swap. Det kan være nødvendigt at øge din glidningstolerance. Hvis det ikke virker, kan der være en uforenelighed med det token, du handler. Bemærk: gebyr ved overførsel og rebase-tokens er inkompatibelt med Uniswap V3.","Approval pending":"Godkendelse afventer","Approve":"Godkend","Approve Permit2":"Approve Permit2","Approve in your wallet":"Godkend i din tegnebog","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Godkend ",["symbol"]," først"],"Auto":"Automatisk","Auto Router":"Auto router","Auto Router API":"Auto Router API","Balance:":"Saldo:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Luk","Confirm in your wallet":"Bekræft i din tegnebog","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Forbind tegnebog","Connecting…":"Tilslutning…","Continue":"Continue","Convert {0} to {1}":["Konverter ",["0"]," til ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Afbryd tegnebogen","Dismiss":"Afvis","Enter an amount":"Indtast et beløb","Error fetching trade":"Fejl ved hentning af handel","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Bedste pris…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Høj glidning øger risikoen for prisbevægelser","I don't have a wallet":"Jeg har ikke en pung","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Utilstrækkelig ",["0"]," saldo"],"Invalid recipient":"Ugyldig modtager","Max":"Maks.","Max slippage":"Max glidning","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Manglende afhængigheder","Network fee":"Netværksgebyr","No results found.":"Ingen resultater fundet.","No tokens are available on this network. Please switch to another network.":"Ingen tokens er tilgængelige på dette netværk. Skift venligst til et andet netværk.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Indtast venligst en gyldig glidning %","Powered by the Uniswap protocol":"Drevet af Uniswap-protokollen","Price impact":"Prispåvirkning","Price updated":"Pris opdateret","Reload":"Reload","Reload the page":"Genindlæs siden","Request rejected":"Request rejected","Review swap":"Anmeldelsesbytte","Search by token name or address":"Søg efter symbolnavn eller adresse","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Noget gik galt","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Succes","Swap":"Byt","Swap failed: {0}":["Skift mislykkedes: ",["0"]],"Switch network":"Skift netværk","Switch network in your wallet":"Skift netværk i din tegnebog","Switching network":"Skifter netværk","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Uniswap-invarianten x * y = k var ikke tilfreds med byttet. Dette betyder normalt, at et af de tokens, du bytter, indeholder brugerdefineret adfærd ved overførsel.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Input-token kan ikke overføres. Der kan være et problem med input-token.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Output-token kan ikke overføres. Der kan være et problem med output-token.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Output-token kan ikke overføres. Der kan være et problem med output-token. Bemærk: gebyr ved overførsel og rebase-tokens er inkompatibelt med Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Denne transaktion lykkes ikke på grund af prisbevægelse. Prøv at øge din glidningstolerance. Bemærk: gebyr ved overførsel og rebase-tokens er inkompatibelt med Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Denne transaktion lykkes ikke på grund af prisbevægelse eller gebyr ved overførsel. Prøv at øge din glidningstolerance.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Frist for transaktion","Transaction rejected":"Transaktion afvist","Transaction submitted":"Transaktion indsendt","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Prøv at øge din glidningstolerance.<0/>BEMÆRK: Gebyr ved overførsel og rebase-tokens er inkompatible med Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Uforventet fejl. Kunne ikke estimere gas til byttet.","Unexpected issue with estimating the gas. Please try again.":"Uventet problem med estimering af gassen. Prøv igen.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Se på Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Advarsel","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Din transaktion vil vende tilbage, hvis den har været afventende i længere tid end denne periode.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Din transaktion vil blive tilbageført, hvis prisen ændres ugunstigt med mere end denne procentdel.","minutes":"minutter","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," gebyr"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

